import React from 'react'
import {DateContainer, Date} from './DateStyles'
const DateToday = () => {

  let today = new Date()
  let date = today.getFullYear() + '-' + today.getMonth() + '-' + today.getDate()

  return (
    <DataContainer>
        <Date>{date}</Date>
    </DataContainer>
  )
}

export default DateToday
